import Common from "./Common";
import web from "../src/images/Paint Bucket Tool (HD).png";
const About = () =>{
  return (
    <>
      <Common
      head1 = "About me as a"
      butn = "Contact Me"
      video = {web}
      />
    </>
  )
}

export default About;
